import React, {useContext} from 'react';
import './css/style.css';
import Header from './Component/header';
import   { ColorUseContext }  from './Component/useContext';


const app = () => {
  let date = useContext(ColorUseContext)
  return (
    <div>
      <Header></Header>

        {date}

    </div>
  )
}




export default app
